INSERT INTO `dsc_discuss_circle` (`dis_id`, `dis_browse_num`, `like_num`, `parent_id`, `quote_id`, `goods_id`, `user_id`, `order_id`, `dis_type`, `dis_title`, `dis_text`, `add_time`, `user_name`) VALUES
(1, 4, 0, 0, 0, 0, 1, 0, 1, '男生大学四年不用洗面奶洗脸，脸居然能脏成这样！', '大学对于很多女生来说是一座“整容院”，但是对于男生来说就不是这样了。不知道大家有没有发现，女生们大学一毕业都出落成了女神范儿，而那些刚开始看着还有点阳光、运动型的男生却是越变越挫了！', 1497478884, 'ecmoban'),
(2, 0, 0, 1, 0, 0, 1, 0, 1, '', '太容易', 1497478903, 'ecmoban'),
(3, 1, 0, 0, 0, 0, 1, 0, 3, '欸，你缺的那款撕拉面膜好像在这里', '夏天油腻腻，别说上妆了，油脂分泌不旺盛不堵塞毛孔，我们就灰常开森啦\r\n这款红茶撕拉面膜，简直就是我的心头爱，膏体丰润绵稠，涂上去快干成膜，深层吸附油脂污垢，撕下来的膜中能清晰可见黑头白头\r\n蕴含红茶精粹，润肤滋养的同时细致毛孔\r\n现在，还有什么理由不趁它断货前，抢到它。', 1497478989, 'ecmoban'),
(4, 1, 1, 0, 0, 0, 1, 0, 3, '想不到吧，这些绘本竟然押了中了2017高考作文题！', '虽然高考已毕，热潮已退，但是对于高考作文题，很多妈妈还是非常关心的，毕竟多年以后，孩子也会一样踏上高考之路！\r\n掐指一算，米妈原来已离高考也有十年多了，看最近几年出的高考作文题，越来越多的不是考查写作的应试技巧，而是考查孩子看待问题的角度、剖析问题的能力，考查的是知识面的广度和深度。而据历年的高考作文学霸来看，他们都不是书呆子，而且阅读量可以说是惊为天地，猎涉面极广！就算去掉他们高考状元的身份，他们的思维习惯也能让他们终身受用：独立思考能力，神采飞扬的自信，苦中作乐的乐观精神，在奋斗过程中有破釜沉舟的执着，这都能更好的考验一个孩子的毅力与内心。\r\n以上这些良好的习惯，都是在他们孩童时代就慢慢形成，', 1497479181, 'ecmoban'),
(5, 1, 0, 0, 0, 0, 1, 0, 2, '在家怎么轻松做出美味小龙虾？', 'lz吃货一枚（吃货密探），大家知道在家怎么做美味小龙虾吗？', 1497479331, 'ecmoban');
INSERT INTO `dsc_drp_config` (`id`, `code`, `type`, `store_range`, `value`, `name`, `warning`, `sort_order`) VALUES
(1, 'notice', 'textarea', '', '亲，您的佣金由三部分组成：\r\n1.本店所销售的商品，我所获得的佣金（即本店销售佣金）\r\n2.下级分店所销售的商品，我所获得的佣金（即一级分店佣金）\r\n3.下级分店发展的分店所销售的商品，我所获得的佣金（即二级分店佣金）', '温馨提示', '申请成为分销商时，提示用户需要注意的信息', 0),
(2, 'novice', 'textarea', '', '1、开微店收入来源之一：您已成功注册微店，已经取得整个商城的商品销售权，只要有人在您的微店购物，即可获得“本店销售佣金”。\r\n2、开微店收入来源之二：邀请您的朋友注册微店，他就会成为你的分销商，他店内销售的商品，您即可获得“一级分店佣金”。\r\n3、开微店收入来源之三：您的分销商邀请他的朋友注册微店，他店内销售的商品，您即可获得“二级分店佣金”。', '新手必读', '分销商申请成功后，用户要注意的事项', 0),
(3, 'withdraw', 'textarea', '', '可提现金额为交易成功后7天且为提现范围内的金额', '提现提示', '申请提现时，少于该值将无法提现', 0),
(4, 'draw_money', 'text', '', '10', '提现金额', '申请提现时，少于该值将无法提现', 0),
(5, 'issend', 'radio', '0,1', '1', '消息推送', '申请店铺成功时,推送消息到微信', 0),
(6, 'isbuy', 'radio', '0,1', '0', '购买成为分销商', '是否开启购买成为分销商,默认申请成为分销商', 0),
(7, 'buy_money', 'text', '', '100', '购买金额', '购买金额达到该数值,才能成为分销商', 0),
(8, 'isdrp', 'radio', '0,1', '1', '商品分销模式', '是否开启分销模式,默认分销模式。控制商品详情页‘我要分销’按钮', 0),
(9, 'ischeck', 'radio', '0,1', '0', '分销商审核', '成为分销商,是否需要审核', 0),
(10, 'drp_affiliate', '', '', 'a:3:{s:2:"on";i:1;s:6:"config";a:3:{s:6:"expire";i:0;s:11:"expire_unit";s:3:"day";s:3:"day";s:1:"7";}s:4:"item";a:3:{i:0;a:3:{s:8:"credit_t";s:3:"30%";s:8:"credit_y";s:3:"40%";s:8:"credit_j";s:3:"50%";}i:1;a:3:{s:8:"credit_t";s:3:"10%";s:8:"credit_y";s:3:"20%";s:8:"credit_j";s:3:"30%";}i:2;a:3:{s:8:"credit_t";s:2:"5%";s:8:"credit_y";s:3:"10%";s:8:"credit_j";s:3:"20%";}}}', '三级分销比例', '', 0),
