(980, '36295478725', 'tmall.com', 1651, 0, 0, '1086-1', '', '正品筱雅男表时尚装韩版潮流复古女表休闲学生皮带情侣手表男女士', '+', 1, 211, '', 21267, '0.000', 0, '100.00', '0.00', '19.80', '19.80', 0, 0, 1, '时尚潮流 情侣表 石英机芯 1086-1 筱雅 普通玻璃镜面 全新 皮革 圆形 2013年 0M 8mm 38mm 国内 复古 合金 店铺保修 指针式', '', '<p style="text-align:center;"> </p> <p style="text-align:center;"> </p> <p style="text-align:center;"><img align="absmiddle" src="http://img.alicdn.com/imgextra/i3/1863385454/TB2IJdgiXXXXXbeXpXXXXXXXXXX_!!1863385454.jpg" size="750x498" /></p> <p align="center" style="margin-top:1.12em;margin-bottom:1.12em;"><font color="#cc0000" size="7"><span style="line-height:67.0px;"><b>收藏店铺和手表</b></span></font></p> <p align="center" style="margin-top:1.12em;margin-bottom:1.12em;line-height:1.4;color:#404040;"><strong><span style="font-size:36.0px;"><span><span style="background-color:#ffd966;"><span style="background-color:#ffff00;"><span style="background-color:#bf9000;"><span style="background-color:#ffd966;"><span style="background-color:#f6b26b;"><span style="background-color:#fff2cc;">再送盒子和原装电池</span></span></span></span></span></span></span></span></strong></p> <p align="center" style="margin-top:1.12em;margin-bottom:1.12em;background-color:white;"><img align="absmiddle" src="http://img.alicdn.com/imgextra/i1/1863385454/T2NzRrXAVbXXXXXXXX_!!1863385454.jpg" style="color:#404040;line-height:1.4;" size="750x500" /></p> <p> </p> <p style="text-align:center;"><span style="font-family:microsoft yahei;"><span style="font-size:36.0px;">韩国时尚经典潮流爆款</span></span></p> <p style="text-align:center;"><span style="color:#20124d;"><span style="font-size:36.0px;"><span style="font-family:microsoft yahei;">时尚与复古的结合</span></span></span></p> <p style="text-align:center;"><span style="color:#20124d;"><span style="font-size:36.0px;"><span style="font-family:microsoft yahei;">继承与创新</span></span></span></p> <p style="text-align:center;"><span style="color:#20124d;"><span style="font-size:36.0px;"><span style="font-family:microsoft yahei;">这正是