(10, 'bank', '银行汇款/转帐', '0', '银行名称\r\n收款人信息：全称 ××× ；帐号或地址 ××× ；开户行 ×××。\r\n注意事项：办理电汇时，请在电汇单“汇款用途”一栏处注明您的订单号。', 0, 'a:0:{}', 1, 0, 0),
(11, 'balance', '余额支付', '0', '使用帐户余额支付。只有会员才能使用，通过设置信用额度，可以透支。', 0, 'a:0:{}', 1, 0, 0),
(12, 'alipay_bank', '支付宝网银直连', '0', '买家可直接通过网上银行进行支付，无需通过支付宝就能完成交易。<br/><a href="https://b.alipay.com/order/productDetail.htm?productId=2011051800325816" target="_blank"><font color="red">立即在线申请</font></a><br/>小提示：网站银行直连接口是与支付宝合作的，故具体银行的的页面上显示的商城名称为"支付宝公司"，请大家放心使用！', 0, 'a:3:{i:0;a:3:{s:4:"name";s:14:"alipay_account";s:4:"type";s:4:"text";s:5:"value";s:0:"";}i:1;a:3:{s:4:"name";s:10:"alipay_key";s:4:"type";s:4:"text";s:5:"value";s:0:"";}i:2;a:3:{s:4:"name";s:14:"alipay_partner";s:4:"type";s:4:"text";s:5:"value";s:0:"";}}', 1, 0, 1),
(13, 'chinabank', '网银在线', '1%', '网银在线（www.chinabank.com.cn）与中国工商银行、招商银行、中国建设银行、农业银行、民生银行等数十家金融机构达成协议。全面支持全国19家银行的信用卡及借记卡实现网上支付。<br/><a href="http://www.chinabank.com.cn" target="_blank">立即在线申请</a>', 0, 'a:2:{i:0;a:3:{s:4:"name";s:17:"chinabank_account";s:4:"type";s:4:"text";s:5:"value";s:0:"";}i:1;a:3:{s:4:"name";s:13:"chinabank_key";s:4:"type";s:4:"text";s:5:"value";s:0:"";}}', 1, 0, 1),
(14, 'chunsejinrong', '白条支付', '0', 'ecmoban模板堂根据京东白条理念自主开发支付方式程序,如您想要在网站中使用白条支付、白条分期,请务必安装此方法!', 0, 'a:0:{}', 1, 0, 1),
(15, 'onlinepay', '在线支付', '0', '想要使用在线支付的一系列方法如支付宝,余额支付,就必须安装该插件,否则订单结算页不会显示"在线支付"按钮', 0, 'a:0:{}', 1, 0, 0),
(16, 'cod', '货到付款', '0', '开通城市：×××\r\n货到付款区域：×××', 0, 'a:0:{}', 1, 1, 0),
(17, 'wxpay', '微信支付', '0', '微信支付，是基于客户端提供的服务功能。同时向商户提供销售经营分析、账户和资金管理的功能支持。用户通过扫描二维码、微信内打开商品页面购买等多种方式调起微信支付模块完成支付。', 0, 'a:4:{i:0;a:3:{s:4:"name";s:11:"wxpay_appid";s:4:"type";s:4:"text";s:5:"value";s:18:"wxe3dbe89d1e41f6e6";}i:1;a:3:{s:4:"name";s:15:"wxpay_appsecret";s:4:"type";s:4:"text";s:5:"value";s:32:"6c87937375486518479b8123f4af11d7";}i:2;a:3:{s:4:"name";s:9:"wxpay_key";s:4:"type";s:4:"text";s:5:"value";s:32:"7CvNWroXDJrujMO7ySZCxkhDNRvOnJiF";}i:3;a:3:{s:4:"name";s:11:"wxpay_mchid";s:4:"type";s:4:"text";s:5:"value";s:10:"1409532202";}}', 1, 0, 1),
(18, 'paypal', 'paypal', '0', 'PayPal（www.paypal.com） 是在线付款解决方案的全球领导者，在全世界有超过七千一百六十万个帐户用户。PayPal 可在 56 个市场以 7 种货币（加元、欧元、英镑、美元、日元、澳元、港元）使用。<br/><a href="https://www.paypal.com/cn/home" target="_blank">立即在线申请</a>', 0, 'a:2:{i:0;a:3:{s:4:"name";s:14:"paypal_account";s:4:"type";s:4:"text";s:5:"value";s:0:"";}i:1;a:3:{s:4:"name";s:15:"paypal_currency";s:4:"type";s:6:"select";s:5:"value";s:3:"USD";}}', 1, 0, 1);
