(8, 7, 100, 0, '100', '0', '可获得陈富息古法手作的横山豆腐乳乾隆贡180g×4瓶； 手剁辣椒酱分享装180g ×2瓶', 'data/zc_product_images/1469562499927290649.jpg', 10, ''),
(15, 11, -1, 0, '1', '0', '每满128位支持者抽取1位幸运用户，不满足时也抽取1位。幸运用户将会获得马来西亚猫山王速冻肉200克一盒。幸运用户将由京东官方抽取，抽奖规则及中奖者名单将在话题区公布。', 'data/zc_product_images/1469568673476363449.jpg', 30, ''),
(16, 11, 500, 0, '198', '0', '感谢您的支持，在众筹结束后 您将获得预估市场价258元的马来西亚猫山王速冻肉400克一盒（顺丰空运，冷藏包装） 偏远地区港澳台勿拍（黑龙江、吉林、甘肃、内蒙古、宁夏、青海、辽宁、新疆、西藏地区）感谢您的支持。', 'data/zc_product_images/1469568703663762791.jpg', 30, '');
INSERT INTO `dsc_zc_initiator` (`id`, `name`, `company`, `img`, `intro`, `describe`, `rank`) VALUES
(2, '无印良品', '无印良品', 'data/initiator_image/1469505347118618837.png', '无印良品是一个日本杂货品牌', '无印良品是一个日本杂货品牌，在日文中意为无品牌标志的好产品。产品类别以日常用品为主。产品注重纯朴、简洁、环保、以人为本等理念，在包装与产品设计上皆无品牌标志。产品类别从铅笔、笔记本、食品到厨房的基本用具都有。最近也开始进入房屋建筑、花店、咖啡店等产业类别。', 1),
(3, '模板堂', '上海商创网络科技有限公司', 'data/initiator_image/1469561234331729031.jpg', 'ecshop模板制作选购第一站，国内专业的ecshop模板开发商，提供完善的ecshop二次开发与模板定制服务以及ecshop插件与ecshop教程。', '上海商创网络科技有限公司（ECSHOP模板堂）是ecshop行业首家股交中心挂牌企业。伴随着ECSHOP一起成长，可以为广大ECSHOP模板使用者提供更为全面的服务。ECSHOP模板堂创始于1999年，是一家连续十余年为中国互联网用户提供服务的运营商，是国内领先的网站建设机构。', 2);
INSERT INTO `dsc_zc_project` (`id`, `cat_id`, `title`, `init_id`, `start_time`, `end_time`, `amount`, `join_money`, `join_num`, `focus_num`, `prais_num`, `title_img`, `details`, `describe`, `risk_instruction`, `img`, `is_best`) VALUES
(7, 16, '一个传统手工艺者的坚守！', '3', '1469548800', '1629993600', '50000', '0', 0, 0, 0, 'data/zc_title_images/1469562442189784660.jpg', '', '可亲临乾隆贡豆腐乳制作现场观摩生产过程，与清代名相陈宏谋第九代后裔陈富息先生面对面交流。', '众筹不是商品交易。支持者根据自己的判断选择、支持众筹项目，与发起人共同实现梦想并获得发起人承诺的回报，众筹存在一定风险。', 'a:4:{i:0;s:38:"data/zc_images/1469562442328950397.jpg";i:1;s:38:"data/zc_images/1469562442476100598.jpg";i:2;s:38:"data/zc_images/1469562442581355809.jpg";i:3;b:0;}', 1),
(11, 9, '世间美味马来西亚猫山王榴莲', '3', '1469548800', '1629993600', '100000', '0', 0, 1, 1, 'data/zc_title_images/1469568606127700771.gif', '无描述', '<p>绝世美味，等你来尝</p>', '<p>1. 众筹不是商品交易。支持者根据自己的判断选择、支持众筹项目，与发起人共同实现梦想并获得发起人承诺的回报，众筹存在一定风险。<br/>2. 京东众筹平台只提供平台网络空间、技术服务和支持等中介服务。京东作为居间方，并不是发起人或支持者中的任何一方，众筹仅存在于发起人和支持者之间，使用京东众筹平台产生的法律后果由发起人与支持者自行承担。<br/>\r\n 3. 众筹项目的回报发放、发票开具及其他后续服务事项均由发起人负责。如果发生发起人无法发放回报、延迟发放回报、不提供回报后续服务等情形，您需要直接和发起人协商解决，京东对此不承担任何责任。<br/>4. 由于发起人能力和经验不足、市场风险、法律风险等各种因素，众筹可能失败。众筹期限届满前失败或募集失败的，您支持的款项会全部原路退还给您；其他情况下，您需要直接和发起人协商解决，京东对此不承担任何责任。<br/>5. 支持纯抽奖档位、无私支持档位及公益众筹项目档位，一旦支付成功将不予退款，众筹失败的除外。<br/></p>', 'a:2:{i:0;s:38:"data/zc_images/1469568631938458354.jpg";i:1;s:38:"data/zc_images/1469568631606654397.gif";}', 1);
